import React, { Component } from "react";


export class Signout extends Component {
  render() {
    return <div title="Sign out of Gmail" style={{ 'color': '#337ab7',backgroundColor: '#17161c',fontSize: 12}} onClick={this.props.onSignout} className='btn ' >Sign Out</div>;
  }
}

export default Signout;
